import React from 'react';

const Profile = () => {
  return (
    <div style={{
      width: 1440,
      height: 1024,
      position: 'relative',
      background: 'white',
      overflow: 'hidden',
    }}>
      {/* Bottom Image (rotated) */}
      <img
        style={{
          width: 1338.24,
          height: 51.22,
          left: 1439,
          top: 1020,
          position: 'absolute',
          transform: 'rotate(180deg)',
          transformOrigin: 'top left'
        }}
        src="https://placehold.co/1338x51"
        alt="footer"
      />

      {/* Background panels */}
      <div style={panelStyle(16.22, 101.68, 1407.56, 820.65, 'rgba(197, 180, 227, 0.41)')} />
      <div style={panelStyle(50.65, 131.93, 547.14, 758.43, 'white')} />
      <div style={panelStyle(613, 132.79, 783.47, 758.43, 'white')} />
      <div style={{
        width: 657.40,
        height: 332.93,
        left: 675.19,
        top: 242.25,
        position: 'absolute',
        background: 'rgba(217, 217, 217, 0.40)',
        borderRadius: 10
      }} />

      {/* Profile Picture */}
      <div style={{ width: 357, height: 357, left: 138.72, top: 169.09, position: 'absolute' }}>
        <div style={{ width: 297.5, height: 297.5, left: 29.75, top: 29.75, position: 'absolute', background: '#A6A6A6' }} />
      </div>
      <div style={headerText(71.22, 156.59, 20, '600')}>Profile Picture</div>
      <div style={headerText(640.99, 156.59, 50, '600')}>My Account</div>

      {/* Section Titles */}
      <div style={headerText(67.98, 598.61, 20, '600')}>Interests</div>
      <div style={headerText(67.98, 731.36, 20, '600')}>Registered Student Organizations</div>
      <div style={{
        left: 160.97, top: 515.18, position: 'absolute',
        textAlign: 'center', display: 'flex', flexDirection: 'column',
        color: 'black', fontSize: 50, fontFamily: 'Ubuntu Sans',
        fontWeight: '600', textDecoration: 'underline', wordWrap: 'break-word'
      }}>
        Profile Name
      </div>

      {/* Tags */}
      {renderTag(88.97, 630.72, 'nature')}
      {renderTag(221.43, 630.72, 'math')}
      {renderTag(339.96, 630.72, 'fashion')}
      {renderTag(88.97, 674.21, '...')}
      {renderTag(259.23, 674.21, 'yoga')}
      {renderTag(375.56, 674.21, 'add more', '#4B2E83', '#E8E3D3')}
    </div>
  );
};

// Helper Styles & Components

const navTextStyle = (left) => ({
  width: 132,
  height: 25,
  left,
  top: 15,
  position: 'absolute',
  textAlign: 'center',
  justifyContent: 'center',
  display: 'flex',
  flexDirection: 'column',
  color: 'white',
  fontSize: 20,
  fontFamily: 'Ubuntu Sans',
  fontWeight: '400',
  wordWrap: 'break-word'
});

const panelStyle = (left, top, width, height, background) => ({
  width,
  height,
  left,
  top,
  position: 'absolute',
  background,
  boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)',
  borderRadius: 20,
  border: '1px black solid'
});

const headerText = (left, top, fontSize, fontWeight) => ({
  left,
  top,
  position: 'absolute',
  textAlign: 'center',
  justifyContent: 'center',
  display: 'flex',
  flexDirection: 'column',
  color: 'black',
  fontSize,
  fontFamily: 'Ubuntu Sans',
  fontWeight,
  wordWrap: 'break-word'
});

const renderTag = (left, top, text, bgColor = '#C5B4E3', textColor = '#4B2E83') => (
  <>
    <div style={{
      width: text.length * 15 + 30,
      height: 33.72,
      left,
      top,
      position: 'absolute',
      background: bgColor,
      borderRadius: 30
    }} />
    <div style={{
      left: left + 30,
      top: top + 3,
      position: 'absolute',
      textAlign: 'center',
      justifyContent: 'center',
      display: 'flex',
      flexDirection: 'column',
      color: textColor,
      fontSize: 20,
      fontFamily: 'Open Sans',
      fontWeight: '600',
      wordWrap: 'break-word'
    }}>
      {text}
    </div>
  </>
);

export default Profile;
